- input: "TEXT\x1CC00366096\x1CX3\x1CC7390264\x1CSA11AI\x1CThis in-kind contribution
    by Jeffrey Drezner is in connection with a joint fundraiser that Van Hollen Victory
    Fund held on Sept 18, 2011.  Van Hollen Victory Fund is a joint committee with
    Victory NOW PAC and Van Hollen for Congress as joint participants.  The total
    in-kind expenses covered were $7563.71 -- $576 paid to Atlantic Valet Services
    for parking and $6987.71 paid to Susan Gage Catering for catering.  Per the contributor's
    wishes, those expenses were allocated as follows: $5000 to Victory NOW PAC, $100
